import "./App.css";

function App() {
  return (
    <>
      <div className="grid h-screen signIn place-items-center ">

        <div className="grid px-8 border  py-14 place-items-center">

          <img className="max-w-52 " src={require("./insta.png")} />

          <form className="flex flex-col gap-1 py-5 text-xs w-60">
            <label htmlFor="username"></label>
            <input className="px-2 py-3 border rounded" placeholder="Phone number, username, or email" type="text" />
            <label htmlFor="username"></label>
            <input className="px-2 py-3 border rounded" placeholder="Password" type="password" />
            <button className="w-full py-2 mt-4 font-semibold text-white rounded-md bg-sky-500">Sign In</button>

          </form>


        <span>Don't have account? <a className="font-semibold text-sky-600" href="">Sign up</a></span>

        </div>



      </div>
    </>
  );
}

export default App;
